高さ調整シートの抜き差しと中材量の調整により、ひとりひとりに合った高さや寝心地に調整ができるハイクラスピロー♪<br>まくら裏面の4か所のファスナーから、中材の出し入れが出来るため、4つの部位ごとの高さが調整可能です。<br>ふっくらとやわらかく優しい寝心地を作るつぶわたを中材に使用したソフトタイプ☆<br>適度なかたさが頭部をしかっりと支え、通気性の良いパイプを中材に使用したハードタイプ☆<br>2つのタイプからお好みに合わせてお選び頂けます！<br>肩口フィット形状で頸椎もしっかり支えます。<br>両サイド高めの形状だから、横向き寝にも対応します。<br>ご家庭で手洗いできるので、いつでも清潔にお使いいただけます。（高さ調整シートは洗えません。）<br><br><br>●商品サイズ（cm）：約32×約45<br>●材質<br>【本体】<br>表面：ニット部分　綿50％、ポリエステル50％／メッシュ部分　ポリエステル60％、ナイロン40％<br>裏面：布帛部分　ポリエステル100％／ニット部分　綿50％、ポリエステル50％<br>マチ部分：ポリエステル60％ナイロン40％<br>詰物：(ソフトタイプ)ポリエステル(わた)<br>(ハードタイプタイプ)ポリエステル<br>【高さ調整シート】<br>側生地：ポリエステル100％<br>詰物：ウレタンフォーム<br>●お手入れ方法<br>・付属の高さ調整シートは洗えませんので、まくら本体のみ手洗いしてください。<br>・洗濯後は詰物の片寄りを直して形を整えてから干して下さい。<br>・色あせの原因となりますので、お干しになる際は風通しのよい日陰で干してください。<br>・タンブラー乾燥機は使用しないでください。<br><style type="text/css">

